 INSERT INTO srdb.assessment VALUES('DFO-NFLD-COD2J3KLIS-1959-2006-PREFONTAINE', 'DFO-NFLD', 'COD2J3KLIS', 'PREFONTAINE', '2008-05-28', '2011-06-14 14:17:10', '1959-2006', 'URL', 'contact details ', 'This assessment focuses on the inshore component of the 2J3KL cod stock as there is very little data on the offshore component. All data concerns the inshore component only except the total landings and total catch time series which are for both components. There was one SPA model used in this assessment; and it was only run for years 1995-2005. The data for total catch is an age-dissaggregated time series that comes from Table 10 in the assessment. The numbers for total landings are the only ones who include the entire area; both offshore and inshore.', '', 1, 1, 'ADAPT', 'no comments', '../spreadsheets/PREFONTAINE-COD2J3KLIS-2006-editedDR.xls', '999') ; 
